import React from "react";
import "../style.css";
import { WHATS_NEW } from "../js/data";
// import { MdNotificationsActive } from 'react-icons/md';

function SingleProject(props) {
    return <article className="whats-new flex">
          <div className="product-details flex">
            <div className="product-name">
              <img src={props.productName} alt="product" />
            </div>
            <div className="about-product">
              <h2 className="productName">{props.productName}</h2>
              <p className="description">{props.description}</p>
              <div className="comments-tags flex">
                <p className="comments">{props.commentCount}</p>
                <p className="tags">{props.tags}</p>
              </div>
            </div>
          </div>
          <div className="upvotes">
            <h5>{props.upvoteCount}</h5>
          </div>
        </article>
}

function Newproducts() {
  return <div  className="left-side">
    {WHATS_NEW.map((product) => {
   return <SingleProject productName={product.productName} image={product.img} />
})}
</div>
}




export default Newproducts;
